//Import the required components
import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import {Typography, Box, Grid, Card, CardActionArea, CardActions, CardContent, CardMedia, Button, Avatar, CardHeader} from '@material-ui/core';
import Navbar from '../navbar/navbar'; 
import G20IMG from '../images/g20IMG.jpg';
import { deepOrange, deepPurple } from '@material-ui/core/colors';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import IconButton from '@material-ui/core/IconButton' 

//CSS Styles
const useStyles = makeStyles(theme => ({
    datasciCard: {
        color: theme.palette.getContrastText(deepOrange[500]),
        backgroundColor: deepOrange[500],
        flex: 'left'
    },
    webdevCard: {
        color: theme.palette.getContrastText(deepPurple[500]),
        backgroundColor: deepPurple[500],
        marginRight: '1rem',
        marginLeft: '1rem'
    },
    mainContainer: {
        background: '#223',
        height: '100%',

    },
    cardContainer: {
        maxWidth: 450,
        margin: '3rem auto'
    },
    header: {
        fontSize: '1.5rem',
        fontWeight: 'bold', 
    },
    headerContainer: {
        margin: '1.2rem 0',
        display: 'flex',
        textAlign: 'center'
    },
    subtitle: {
        flex: 'left'
    },
    cardContent: {
        fontSize: '0.9rem',
    },
    subHeading: {
        fontSize: '1rem',
        fontWeight: 'bold'
    },


}))


const Projects = () => {
    const classes = useStyles();
    return (   
        <Box component='div' className={classes.mainContainer}>
            <Navbar/>

            <Grid container justify='center'>
                {/* Project 1 */}
                <Grid item xs={12} sm={8} md={6}>
                    <Card className={classes.cardContainer}>
                        <CardHeader 
                            avatar=
                            {<Avatar aria-label='Data Science' className={classes.datasciCard}>
                                D
                            </Avatar>} 
                            action={
                                <IconButton aria-label="settings">
                                    <MoreVertIcon />
                                </IconButton>
                            }
                        /> 

                        {/* <Box className={classes.headerContainer}>
                            <Avatar className={classes.datasciCard}>D</Avatar>
                            <Typography gutterBottom className={classes.header}>
                                G20 Text Analysis 
                            </Typography>
                            <Typography className={classes.subtitle} color='textSecondary'>Date Completed: Aug 2019</Typography>
                        </Box> */}

                        <CardMedia
                        component="img"
                        alt="project 1"
                        height="250"
                        image={G20IMG}
                        /> 
                        <CardActionArea>
                            <CardContent>
                                <Typography className={classes.cardContent} component='p'>
                                    Every few years leaders throughout the globe meet for a summit to discuss world issues. The recent G20 Summit held in Osaka commenced on the 28th Jun 2019. This is the few times that every leader in the world so most of the global issues will be covered during this meeting. Things such as world hunger, third world poverty and climate change are all common topics for this summit. 
                                </Typography>
                                <br/>
                                <Typography className={classes.subHeading} color="textSecondary" component='p'>
                                    Why use programming to solve this issue?
                                </Typography>
                                <Typography className={classes.cardContent} component='p'>
                                    This was such a wide scale event covered by almost every main country such as Japan, Korea, USA, Australia just to name a few. This would mean that thousands of news outlets across the world would release articles on this particular event. Sure it would be possible 
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                            <CardActions>
                                <Button size='small' color='primary'>
                                    See More
                                </Button>
                                <Button size='small' color='secondary'>
                                    Code Repository 
                                </Button>
                            </CardActions>
                    </Card>
                </Grid>
                <Grid item xs={12} sm={8} md={6}>
                    <Card className={classes.cardContainer}>
                        <CardActionArea>
                            <CardMedia
                                component="img"
                                alt="project 1"
                                height="200"
                                image={G20IMG}
                            /> 
                            <CardContent>
                                <Typography gutterBottom variant="h5">
                                    G20 Text Analysis 
                                </Typography>
                                <Typography variant="body2" color="textSecondary" component='p'>
                                    Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. 
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                            <CardActions>
                                <Button size='small' color='primary'>
                                    See More
                                </Button>
                                <Button size='small' color='secondary'>
                                    Code Repository 
                                </Button>
                            </CardActions>
                    </Card>
                </Grid>

            </Grid>
        </Box>





        );
  }

  export default Projects;
